using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Drawing;
using System.Data;
using System.Text;
using System.Linq;
using System.Threading.Tasks;
using System.Windows.Forms;
using DevExpress.XtraEditors;
using System.ComponentModel.DataAnnotations;
using System.IO;
using DevExpress.XtraLayout.Helpers;
using DevExpress.XtraLayout;

namespace QuanLyKho
{
    public partial class UCMainAdministrator : DevExpress.XtraEditors.XtraUserControl
    {
        public UCMainAdministrator()
        {
            InitializeComponent();

            gridControl1.DataSource = GetDataSource();
            labelControl.Text = "Xin chào " + FormMain.nguoiDung.Ho + " " + FormMain.nguoiDung.Ten;
        }
        static List<QuickReport> GetDataSource()
        {
            List<QuickReport> result = new List<QuickReport>();
            QuickReport qr = new QuickReport();
            qr.Type = "Doanh thu ngày:";
            qr.Value = "30,000,000 VNĐ";
            qr.Image = Base64ToImage(MoneyPic);
            result.Add(new QuickReport()
            {
                Type = "Doanh thu ngày:",
                Value = "30,483,000 VNĐ",
                Image = Base64ToImage(MoneyPic)
            });
            result.Add(new QuickReport()
            {
                Type = "Hoàng Trần Hảo bán:",
                Value = "50 sản phẩm",
                Image = Base64ToImage(UserPic)
            });
            result.Add(new QuickReport()
            {
                Type = "Bán chạy nhất:",
                Value = "Nồi cơm điện",
                Image = Base64ToImage(ProductPic)
            });
            return result;
        }
        public static Image Base64ToImage(string base64Image)
        {
            using (MemoryStream ms = new MemoryStream(Convert.FromBase64String(base64Image)))
            {
                Image image = Image.FromStream(ms, true);
                return image;
            }
        }
        public enum Gender { Male, Female }
        public class QuickReport
        {
            public string Type { get; set; }
            public string Value { get; set; }
            public Image Image { get; set; }
        }
        public const string MoneyPic = "";
        public const string UserPic = "";
        public const string ProductPic = "";
    }
}
